import React from 'react'

const CLIENT_ID = "aab216eddd2d26ddfc43"


const LoginPage = () => {

    function loginWithGithub() {
        window.location.assign("https://github.com/login/oauth/authorize?client_id=" + CLIENT_ID)
    }

    return (
        <h1>HELLO</h1>

    )
}

export default LoginPage
